import c1 from '../src/images/mask.webp';
import c2 from '../src/images/200w.webp';
import c3 from '../src/images/dist.webp';
import c4 from '../src/images/home.webp';

const prec = [{image :c2,title:"Wash Your Hands",text:'Clean your hands often. Use soap and water, or an alcohol-based hand rub.'},
              {image:c1,title:"Wear Mask" ,text:"Wear a mask when physical distancing is not possible, it's important!"},
              {image:c3,title:"Keep Distance",text:"Maintain a safe distance from anyone who is coughing or sneezing."},
              {image:c4,title:"Stay Home",text:"Avoid public spaces and social gatherings. Stay home, Stay Safe "}];



export default prec;
